//获取APP流水号
(function getCounterFromClient(){
    //alert("初始化第一次自己调用");
    HZ_APP_JSSDK.showToast("初始化第一次自己调用55");
    var seqid = HZ_APP_JSSDK.getCounterFromClient();
    //传给APP
    function getCounterFromHtml(){
        // alert("h5方法");
        HZ_APP_JSSDK.showToast("h5方法55");
        return seqid;
    }

})();

function getCounterFromClient(){
    // alert("进入时调用");
    HZ_APP_JSSDK.showToast("进入时调用55");
    var seqid = HZ_APP_JSSDK.getCounterFromClient();
}

function getCounterFromHtml(){
    // alert("离开时调用");
    HZ_APP_JSSDK.showToast("离开时调用55");
    var strs = 1;
    strs++;
    return strs;
}


//安卓
function setCounterInHtml(){
    HZ_APP_JSSDK.showToast("安卓低版本 离开时调用55");
    var num =1;
    HZ_APP_JSSDK.setCounterInClient(num);
    HZ_APP_JSSDK.showToast("安卓低版本 离开时调用55");

}